import { Fragment, useState} from "react";
import React from "react";

const Register = () => {
    return (<Fragment>
        <form className="form-control" >
            <h1 className="text-center"> 
                Register
            </h1>
        </form>
    </Fragment>);
};

const navBar = () => {
    return (<div>
      <li>
        <Link to="/register">register</Link>
      </li>
      <li>
        <Link to="/login">login</Link>
      </li>
    </div>);
  };

export default Register;
